function ValidarFormulario(){var n="";return $(".validar").find("span[id*=-error]").each(function(t,i){n+=$(i).text()+"<br>"}),n}let fase=0;$(function(){try{fetch("//api.ipify.org?format=json").then(n=>n.json()).then(n=>{$("#spanip").text(`Seu IP: ${n.ip}`)}).catch(()=>{$("#spanip").text("")})}catch(n){console.log(n)}Carregar(0);$("#lnkAvançar").click(n=>{var r,t;n.preventDefault();let i=$("#frmExterno");if(i.valid()){r=$('input[name="__RequestVerificationToken"]',i).val();let n={__RequestVerificationToken:r,fase:fase,cpf:$("#Cpf").val(),valor:""};fase==0?$.ajaxPost(urlPesquisarMembro,n,function(n){n.Status==="OK"?(fase++,Carregar(fase)):$.bsMessageError("Atenção",n.Msg)}):fase===1?(n.valor=$("#NomeMae").val(),$.ajaxPost(urlPesquisarMembro,n,function(n){n.Status==="OK"?(fase++,Carregar(fase)):$.bsMessageError("Atenção",n.Msg)})):fase===2&&(n.valor=$("#DataNascimento").val(),$.ajaxPost(urlPesquisarMembro,n,function(n){n.Status==="OK"?window.location=n.Url:$.bsMessageError("Atenção",n.Msg)}))}else t=ValidarFormulario(),t!=null&&t!=undefined&&t!=""&&$.alertError("Membro",t)})});const Carregar=n=>{switch(n){case 0:$("#divCpf").show();$("#divNomeMae").hide();$("#divDataNasc").hide();break;case 1:$("#divCpf").hide();$("#divNomeMae").show();$("#divDataNasc").hide();break;case 2:$("#divCpf").hide();$("#divNomeMae").hide();$("#divDataNasc").show()}};